function random(x, y)
    x = x or 0; y = y or 0
    math.randomseed(os.time() * math.random(1000, 1000000))
    data.r = data.r + tonumber(math.random(1000, 1000000))
    if x == 0 and y == 0 then math.randomseed(data.r) if (math.random(data.r) % 2) == 1 then return 1 else return 0 end
    elseif not (x == 0) and y == 0 then math.randomseed(data.r) return math.random(x)
    else math.randomseed(data.r) return math.random(x, y) end
end
function checkmove()
	if (data.gblocks[1] + data.gblocks[2] + data.gblocks[3] + data.block_grab[1] == 0) or #data.anims > 0 then return true end
	for a = 1, 9 do
		for b = 1, 9 do
			if data.field[a][b] ~= 1 then
				for c = 1, 4 do
					if (data.gblocks[c] ~= 0) or (c == 4 and data.block_grab[1] ~= 0) then
						local gblc = (c == 4 and data.block_grab[1] ~= 0) and data.block_grab[1] or data.gblocks[c]
						if gblc ~= nil then
							local temp_cords = {}
							for i = 1, #data.blocks[gblc] do
								temp_cords[i] = {data.blocks[gblc][i][1], data.blocks[gblc][i][2]}
							end
							for d = 1, 4 do
								for i = 1, #temp_cords do

									local rendr = true
									for e = 1, #temp_cords do
										local px, py = (temp_cords[e][1] - temp_cords[i][1]), (temp_cords[e][2] - temp_cords[i][2])
										if a - py > 9 or a - py < 1 then rendr = false; break end
										if b + px > 9 or b + px < 1 then rendr = false; break end
										if data.field[a-py][b+px] == 1 then rendr = false; break end
									end
									if rendr then
										local return_cords = {}
										for e = 1, #temp_cords do
											local px, py = (temp_cords[e][1] - temp_cords[i][1]), (temp_cords[e][2] - temp_cords[i][2])
											table.insert(return_cords, {a-py, b+px})
										end
										return return_cords end
								end
								local min_y, min_x = 0, 0
								for i = 1, #temp_cords do
									local x = temp_cords[i][1]
									local y = temp_cords[i][2]
									temp_cords[i][1] = y
									temp_cords[i][2] = -1*x
									if temp_cords[i][1] < min_x then min_x = temp_cords[i][1] end
									if temp_cords[i][2] < min_y then min_y = temp_cords[i][2] end
								end
								for i = 1, #temp_cords do
									temp_cords[i][1] = temp_cords[i][1] + math.abs(min_x)
									temp_cords[i][2] = temp_cords[i][2] + math.abs(min_y)
								end
							end
						else c = 1 end
					end
				end
			end
		end
	end
	return false
end
function usehint()
	if data.hint_kd > 0 then return false end
	local res = checkmove()
	if type(res) == "table" then
		for i = 1, #res do 
			data.hint_blocks[res[i][1]..","..res[i][2]] = data.max_anim
		end
	end
	data.hint_kd = 10
end
function btw(i, m, n) return (i >= math.min(m,n) and i <= math.max(m,n)) end
function updateData()
	data.field = {}
	for i = 1, 9 do
		table.insert(data.field, {})
		for j = 1, 9 do
			table.insert(data.field[i], 0)
	end end
	data.nomove = false
	data.hint_kd = 0
	data.score = 0
	data.block_grab = {0, 0}
	lockPlayerControl(false)
	data.timep = {0, 0}
	local gblocks_r = true
	data.gblocks = {random(#data.blocks),random(#data.blocks),random(#data.blocks)}
	while gblocks_r do
		if data.gblocks[1] ~= data.gblocks[2] and
		   data.gblocks[1] ~= data.gblocks[3] and
		   data.gblocks[2] ~= data.gblocks[3] then
		   	gblocks_r = false
		else data.gblocks = {random(#data.blocks),random(#data.blocks),random(#data.blocks)}
		end
	end
end
