function checkField()
	local queue = {}
	for a = 1, 9 do
		-- 
		local nofull = false
		for i = 1, 9 do if data.field[a][i] == 0 then nofull = true; break end end
		if not nofull then for i = 1, 9 do table.insert(queue, {a, i}) end end
		-- 
		nofull = false
		for i = 1, 9 do if data.field[i][a] == 0 then nofull = true; break end end
		if not nofull then for i = 1, 9 do table.insert(queue, {i, a}) end end
		-- 
		nofull = false
		for i = 1, 9 do
			if data.field[((a%3 == 0 and 3 or a%3)-1)*3 + (i%3 == 0 and 3 or i%3)][math.ceil(i/3)+ (math.ceil(a/3)-1)*3] == 0 then
				nofull = true; break
			end
		end
		if not nofull then for i = 1, 9 do table.insert(queue, {((a%3 == 0 and 3 or a%3)-1)*3 + (i%3 == 0 and 3 or i%3), math.ceil(i/3)+ (math.ceil(a/3)-1)*3}) end end
	end
	if #queue == 0 then return false else
		for i = 1, #queue do
			data.anims[queue[i][1]..","..queue[i][2]] = data.max_anim
		end
		return queue end
end
