    imgui.SetNextWindowSize(imvec2(data.csize[0]*13, data.csize[0]*16))
    imgui.Begin("##Block Game", data.WinOpen, imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoResize + (data.lock[0] and imgui.WindowFlags.NoMove or imgui.WindowFlags.None))
    local dl = imgui.GetWindowDrawList()
    dl:AddImage(data.img.bg, imgui.GetWindowPos(), imvec2(imgui.GetWindowPos().x + imgui.GetWindowSize().x, imgui.GetWindowPos().y + imgui.GetWindowSize().y))
    dl:AddRect(imvec2(imgui.GetWindowPos().x-data.csize[0]/8 + data.csize[0]*2, imgui.GetWindowPos().y + data.csize[0]-data.csize[0]/8), imvec2(imgui.GetWindowPos().x + data.csize[0]*11+data.csize[0]/8, imgui.GetWindowPos().y + data.csize[0]*10+data.csize[0]/8), 0xFF202e42, 0, 1, data.csize[0]/4)
    local osclock = os.clock()
    if osclock - data.timep[2] >= 1 then
    	data.timep = {data.timep[1] + 1, osclock}
    	if not checkmove() then data.nomove = true
    	else data.nomove = false end
    	if data.hint_kd > 0 then data.hint_kd = data.hint_kd - 1 end
    end
    imgui.SetCursorPos(imvec2(data.csize[0]*2, data.csize[0]))
    for i = 1, 9 do
    	for j = 1, 9 do
    		local c_col = nil
    		if data.hint_blocks[i..","..j] ~= nil then
    			if data.hint_blocks[i..","..j] > data.min_anim then
    				c_col = (math.ceil(data.hint_blocks[i..","..j]/10)%2 == 1) and 0xFF535353 or c_col
    				data.hint_blocks[i..","..j] = data.hint_blocks[i..","..j] - data.hint_step_anim
    			else data.hint_blocks[i..","..j] = nil end
    		end
    		local coords = {imvec2((174/3)/174, 0),imvec2((174/3)/174*2, 1)}
    		local mod = 1.0
    		if data.field[i][j] == 1 then
    			if data.anims[i..","..j] ~= nil then
    				if data.anims[i..","..j] > data.min_anim then
	    				mod = data.anims[i..","..j]/data.max_anim
	    				data.anims[i..","..j] = data.anims[i..","..j] - data.step_anim
	    			else
	    				data.anims[i..","..j] = nil
	    				data.field[i][j] = 0
	    			end
    			end
    			coords = {imvec2(0, 0),imvec2((174/3)/174, 1)}
    		elseif (btw(i,1,3) and btw(j,1,3)) or
			   (btw(i,1,3) and btw(j,7,9)) or
			   (btw(i,4,6) and btw(j,4,6)) or
			   (btw(i,7,9) and btw(j,1,3)) or
			   (btw(i,7,9) and btw(j,7,9)) then
				coords = {imvec2((174/3)/174*2, 0),imvec2(1, 1)}
			end
    		dl:AddImage(data.img.blocks,
    			imvec2(
    				imgui.GetWindowPos().x + imgui.GetCursorPosX() + data.csize[0]*(1-mod),
    				imgui.GetWindowPos().y + imgui.GetCursorPosY() + data.csize[0]*(1-mod)
    			),
    			imvec2(
    				imgui.GetWindowPos().x + imgui.GetCursorPosX()+data.csize[0]*mod,
    				imgui.GetWindowPos().y + imgui.GetCursorPosY()+data.csize[0]*mod
    			),
    			coords[1], coords[2], (coords[2].x/coords[1].x == 2 and c_col == nil) and 0xFFAAAAAA or c_col)
    		imgui.SetCursorPosX(imgui.GetCursorPosX()+data.csize[0])
    	end
    	imgui.SetCursorPosX(data.csize[0]*2)
    	imgui.SetCursorPosY(imgui.GetCursorPosY()+data.csize[0])
	end
	imgui.SetCursorPos(imvec2(data.csize[0]*2, data.csize[0]*15))
	data.csize[0] = data.csize[0] * data.gms
	for i = 1, 3 do
		if data.gblocks[i] ~= 0 then
			for j = 1, #data.blocks[data.gblocks[i]] do
				local pa, pb = imvec2(
					imgui.GetWindowPos().x + imgui.GetCursorPosX() + data.blocks[data.gblocks[i]][j][1]*data.csize[0], -- x
					imgui.GetWindowPos().y + imgui.GetCursorPosY() - data.blocks[data.gblocks[i]][j][2]*data.csize[0]  -- y
				), imvec2(
					imgui.GetWindowPos().x + imgui.GetCursorPosX() + data.blocks[data.gblocks[i]][j][1]*data.csize[0] + data.csize[0], -- x
					imgui.GetWindowPos().y + imgui.GetCursorPosY() - data.blocks[data.gblocks[i]][j][2]*data.csize[0] - data.csize[0]  -- y
				)
				dl:AddImage(data.img.blocks, pa, pb, {x=0,y=0},{x=(174/3)/174,y=1})
				if imgui.dlIsItemClicked(pa, pb) and data.block_grab[1] == 0 and data.block_grab[2] == 0 then
					data.block_grab = {data.gblocks[i], j}
					data.gblocks[i] = 0
					break
				end
			end
		end
		imgui.SetCursorPosX(imgui.GetCursorPosX() + data.csize[0]*6)
	end
	data.csize[0] = data.csize[0] / data.gms
	if data.block_grab[1] ~= 0 and data.block_grab[2] ~= 0 then
		local blkg = data.block_grab[1]
		local blkgb = data.block_grab[2]
		sCurPos = imvec2(imgui.GetWindowPos().x + data.csize[0]*2, imgui.GetWindowPos().y + data.csize[0])
		for i = 1, 9 do
			for j = 1, 9 do
				local pa, pb = imvec2(sCurPos.x, sCurPos.y), imvec2(sCurPos.x + data.csize[0], sCurPos.y + data.csize[0])
				if imgui.dlIsItemHovered(pa, pb) then 
					local rendr = true
					for b = 1, #data.blocks[blkg] do
						local px, py = (data.blocks[blkg][b][1] - data.blocks[blkg][blkgb][1]), (data.blocks[blkg][b][2] - data.blocks[blkg][blkgb][2])
						if i - py > 9 or i - py < 1 then rendr = false; break end
						if j + px > 9 or j + px < 1 then rendr = false; break end
						if data.field[i-py][j+px] == 1 then rendr = false; break end
					end
					if rendr then
						for b = 1, #data.blocks[blkg] do
							local px, py = (data.blocks[blkg][b][1] - data.blocks[blkg][blkgb][1]), (data.blocks[blkg][b][2] - data.blocks[blkg][blkgb][2])				
							dl:AddImage(data.img.blocks,
								imvec2(
									imgui.GetWindowPos().x + data.csize[0] + data.csize[0]*(j+px),
									imgui.GetWindowPos().y + data.csize[0]*i - data.csize[0]*py
								),
								imvec2(
									imgui.GetWindowPos().x + data.csize[0] + data.csize[0]*(j+px) + data.csize[0],
									imgui.GetWindowPos().y + data.csize[0]*i - data.csize[0]*py + data.csize[0]
								), {x=0,y=0},{x=(174/3)/174,y=1}, 0xFFCCCCCC
							)
						end 
						if imgui.dlIsItemClicked(pa, pb) then
							for b = 1, #data.blocks[blkg] do
								local px, py = (data.blocks[blkg][b][1] - data.blocks[blkg][blkgb][1]), (data.blocks[blkg][b][2] - data.blocks[blkg][blkgb][2])
								data.field[i-py][j+px] = 1
							end
							lockPlayerControl(false)
							data.block_grab = {0, 0}
							local cres = checkField()
							if type(cres) == 'table' then
								for i = 1, #cres do
									--data.field[cres[i][1]][cres[i][2]] = 0
									data.score = data.score + 10
								end
							else if not checkmove() then data.nomove = true end
							end
							if data.gblocks[1] == 0 and data.gblocks[2] == 0 and data.gblocks[3] == 0 then
								local gblocks_r = true
								data.gblocks = {random(#data.blocks),random(#data.blocks),random(#data.blocks)}
								while gblocks_r do
									if data.gblocks[1] ~= data.gblocks[2] and
									   data.gblocks[1] ~= data.gblocks[3] and
									   data.gblocks[2] ~= data.gblocks[3] then
									   	gblocks_r = false
									else data.gblocks = {random(#data.blocks),random(#data.blocks),random(#data.blocks)}
									end
								end
							end
						end
					end
				end
				sCurPos.x = sCurPos.x + data.csize[0]
	    	end
	    	sCurPos.x = imgui.GetWindowPos().x + data.csize[0]*2
	    	sCurPos.y = sCurPos.y + data.csize[0]
    	end
		if imgui.IsMouseClicked(1) then
			for i = 1, 3 do
				if data.gblocks[i] == 0 then
					data.gblocks[i] = data.block_grab[1];
					break
			end end
			data.block_grab = {0, 0}
			lockPlayerControl(false)
			return;
		end
		local sCurPos = imgui.GetMousePos()
		sCurPos = {x = sCurPos.x - data.csize[0]/2, y = sCurPos.y - data.csize[0]/2}
		for i = 1, #data.blocks[blkg] do
			dl:AddImage(data.img.blocks,
				imvec2(
					sCurPos.x + data.csize[0] * (data.blocks[blkg][i][1] - data.blocks[blkg][blkgb][1]),
					sCurPos.y - data.csize[0] * (data.blocks[blkg][i][2] - data.blocks[blkg][blkgb][2])
				),
				imvec2(
					sCurPos.x + data.csize[0] * (data.blocks[blkg][i][1] - data.blocks[blkg][blkgb][1]) + data.csize[0],
					sCurPos.y - data.csize[0] * (data.blocks[blkg][i][2] - data.blocks[blkg][blkgb][2]) + data.csize[0]
				), {x=0,y=0},{x=(174/3)/174,y=1}
			)
		end
	end
	-- reset
	imgui.SetCursorPos(imvec2(data.csize[0]*2, data.csize[0]*10.3))
	imgui.PushStyleVarFloat(imgui.StyleVar.FrameRounding, 30)
	if imgui.Button(u8"", imvec2(data.csize[0]*2, data.csize[0]*0.7)) then updateData() end
	-- score shadow
	imgui.PopStyleVar(1)
	imgui.SetCursorPos(imvec2(data.csize[0]*4.2, data.csize[0]*10.3))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
	imgui.Text(u8(": "..data.score))
	imgui.PopStyleColor(1)
	-- score
	imgui.SetCursorPos(imvec2(data.csize[0]*4.2+2, data.csize[0]*10.3+2))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
	imgui.Text(u8(": "..data.score))
	imgui.PopStyleColor(1)
	-- time shadow
	imgui.SetCursorPos(imvec2(data.csize[0]*4.2, data.csize[0]*10.8))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
	imgui.Text(u8(": "..convertTime(data.timep[1])))
	imgui.PopStyleColor(1)
	-- time
	imgui.SetCursorPos(imvec2(data.csize[0]*4.2+2, data.csize[0]*10.8+2))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
	imgui.Text(u8(": "..convertTime(data.timep[1])))
	imgui.PopStyleColor(1)
	-- size shadow
	imgui.SetCursorPos(imvec2(data.csize[0]*7.5, data.csize[0]*10.3))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
	imgui.Text(u8(":"))
	imgui.PopStyleColor(1)
	-- size
	imgui.SetCursorPos(imvec2(data.csize[0]*7.5+2, data.csize[0]*10.3+2))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
	imgui.Text(u8(":"))
	imgui.PopStyleColor(1)
	-- size slider
	imgui.SetCursorPos(imvec2(data.csize[0]*7.5, data.csize[0]*11))
	imgui.SetNextItemWidth(data.csize[0]*2)
	imgui.SliderFloat("##size",data.csizetemp,30.0,50.0,"%.0f",1)
	if imgui.IsItemDeactivatedAfterEdit() then
		data.csize[0] = data.csizetemp[0]
	end
	local tcal = imgui.CalcTextSize(u8".").x
	-- lock shadow
	imgui.SetCursorPos(imvec2(data.csize[0]*11 - tcal, data.csize[0]*10.3))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
	imgui.Text(u8".\n:")
	imgui.PopStyleColor(1)
	-- lock
	imgui.SetCursorPos(imvec2(data.csize[0]*11+2 - tcal, data.csize[0]*10.3+2))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
	imgui.Text(u8".\n:")
	imgui.PopStyleColor(1)
	-- lock button
	imgui.SetCursorPos(imvec2(data.csize[0]*11+2 - tcal, data.csize[0]*11.3))
 	imgui.ToggleButton("", data.lock)
 	-- hint
 	local hp1, hp2 =
 		imvec2(imgui.GetWindowPos().x + data.csize[0]*0.5, imgui.GetWindowPos().y + data.csize[0]*0.5),
		imvec2(imgui.GetWindowPos().x + data.csize[0]*1.5, imgui.GetWindowPos().y + data.csize[0]*1.5)
 	dl:AddImage(data.img.hint,
 		hp1, hp2,
    	imvec2(0, 0), imvec2(1, 1),
    	data.hint_kd > 0 and 0xFF333333 or -1)
 	if imgui.dlIsItemClicked(hp1, hp2) then
 		usehint()
 	end
 	if data.hint_kd > 0 then
 		local hkdc = imgui.CalcTextSize(u8(tostring(data.hint_kd)))
 		-- hint kd shadow
		imgui.SetCursorPos(imvec2(data.csize[0] - hkdc.x/2 ,data.csize[0]*1.5+2))
		imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
		imgui.Text(u8(tostring(data.hint_kd)))
		imgui.PopStyleColor(1)
		-- hint kd
		imgui.SetCursorPos(imvec2(data.csize[0] - hkdc.x/2, data.csize[0]*1.5+4))
		imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
		imgui.Text(u8(tostring(data.hint_kd)))
		imgui.PopStyleColor(1)
 	end
 	if data.nomove then
 		local nomt = "\n"
 		local hkdc = imgui.CalcTextSize(u8(tostring(nomt)))
 		-- no move shadow
		imgui.SetCursorPos(imvec2(data.csize[0] - hkdc.x/2 ,data.csize[0]*2+2))
		imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(0,0,0,1))
		imgui.Text(u8(tostring(nomt)))
		imgui.PopStyleColor(1)
		-- no move
		imgui.SetCursorPos(imvec2(data.csize[0] - hkdc.x/2, data.csize[0]*2+4))
		imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,0.1,0.1,1))
		imgui.Text(u8(tostring(nomt)))
		imgui.PopStyleColor(1)
 	end
 	-- collapce shadow
 	dl:AddLine(
 		imvec2(
 			imgui.GetWindowPos().x + data.csize[0]*11.7,
 			imgui.GetWindowPos().y + data.csize[0]*0.7),
 		imvec2(
 			imgui.GetWindowPos().x + data.csize[0]*12.2,
 			imgui.GetWindowPos().y + data.csize[0]*0.7),
 		0xFF000000, 3.0)
 	dl:AddLine(
 		imvec2(
 			imgui.GetWindowPos().x + 2+data.csize[0]*11.7,
 			imgui.GetWindowPos().y + data.csize[0]*0.7+2),
 		imvec2(
 			imgui.GetWindowPos().x + 2+data.csize[0]*12.2,
 			imgui.GetWindowPos().y + data.csize[0]*0.7+2),
 		0xFFFFFFFF, 3.0)
 	if imgui.dlIsItemClicked(
 		imvec2(
 			imgui.GetWindowPos().x + data.csize[0]*11.4,
 			imgui.GetWindowPos().y + data.csize[0]*0.4),
 		imvec2(
 			imgui.GetWindowPos().x + data.csize[0]*12.5,
 			imgui.GetWindowPos().y + data.csize[0])
 		) then data.WinOpen[0] = false; lockPlayerControl(false) end
 	imgui.SetCursorPos(imvec2(data.csize[0]*2.5-imgui.CalcTextSize(u8"(?)").x+1, data.csize[0]*0.2+1))
	imgui.PushStyleColor(imgui.Col.Text, imgui.ImVec4(1,1,1,1))
	imgui.Text(u8('(?)'))
	imgui.PopStyleColor(1)
 	imgui.SetCursorPos(imvec2(data.csize[0]*2.5-imgui.CalcTextSize(u8"(?)").x, data.csize[0]*0.2))
 	imgui.PushStyleColor(imgui.Col.TextDisabled, imgui.ImVec4(0,0,0,1))
 	imgui.TextQuestion('(?)', u8'       -    \n   ,  \n   ,    -  A (.)  D (.)')
	imgui.PopStyleColor(1)
    imgui.End()
end)

function imgui.dlIsItemClicked(a, b)
	local mouse_pos = imgui.GetMousePos()
	if  mouse_pos.x > (a.x < b.x and a.x or b.x) and
		mouse_pos.x < (a.x > b.x and a.x or b.x) and
		mouse_pos.y > (a.y < b.y and a.y or b.y) and
		mouse_pos.y < (a.y > b.y and a.y or b.y) and
		imgui.IsMouseClicked(0) then return true
	else return false end 
end
function imgui.dlIsItemHovered(a, b)
	local mouse_pos = imgui.GetMousePos()
	if  mouse_pos.x > (a.x < b.x and a.x or b.x) and
		mouse_pos.x < (a.x > b.x and a.x or b.x) and
		mouse_pos.y > (a.y < b.y and a.y or b.y) and
		mouse_pos.y < (a.y > b.y and a.y or b.y) then
		return true else return false
	end 
end

function main()
	while not isSampAvailable() do wait(100) end
	updateData()
	sampRegisterChatCommand("WBG", function() data.WinOpen[0] = not data.WinOpen[0] end)
	while true do wait(1)
		if data.block_grab[1] ~= 0 and data.block_grab[2] ~= 0 and data.WinOpen[0] then
			if isKeyJustPressed(0x41) then
				lockPlayerControl(true)
				local min_y, min_x = 0, 0
				for i = 1, #data.blocks[data.block_grab[1]] do
					local x = data.blocks[data.block_grab[1]][i][1]
					local y = data.blocks[data.block_grab[1]][i][2]
					data.blocks[data.block_grab[1]][i][1] = -1*y
					data.blocks[data.block_grab[1]][i][2] = x
					if data.blocks[data.block_grab[1]][i][1] < min_x then min_x = data.blocks[data.block_grab[1]][i][1] end
					if data.blocks[data.block_grab[1]][i][2] < min_y then min_y = data.blocks[data.block_grab[1]][i][2] end
				end
				for i = 1, #data.blocks[data.block_grab[1]] do
					data.blocks[data.block_grab[1]][i][1] = data.blocks[data.block_grab[1]][i][1] + math.abs(min_x)
					data.blocks[data.block_grab[1]][i][2] = data.blocks[data.block_grab[1]][i][2] + math.abs(min_y)
				end
			end
			if isKeyJustPressed(0x44) then
				lockPlayerControl(true)
				local min_y, min_x = 0, 0
				for i = 1, #data.blocks[data.block_grab[1]] do
					local x = data.blocks[data.block_grab[1]][i][1]
					local y = data.blocks[data.block_grab[1]][i][2]
					data.blocks[data.block_grab[1]][i][1] = y
					data.blocks[data.block_grab[1]][i][2] = -1*x
					if data.blocks[data.block_grab[1]][i][1] < min_x then min_x = data.blocks[data.block_grab[1]][i][1] end
					if data.blocks[data.block_grab[1]][i][2] < min_y then min_y = data.blocks[data.block_grab[1]][i][2] end
				end
				for i = 1, #data.blocks[data.block_grab[1]] do
					data.blocks[data.block_grab[1]][i][1] = data.blocks[data.block_grab[1]][i][1] + math.abs(min_x)
					data.blocks[data.block_grab[1]][i][2] = data.blocks[data.block_grab[1]][i][2] + math.abs(min_y)
				end
			end
		end
	end
end
imgui.OnInitialize(function()
	data.img.blocks = imgui.CreateTextureFromFileInMemory(imgui.new('const char*', data.img.blocks_data), #data.img.blocks_data)
	data.img.hint = imgui.CreateTextureFromFileInMemory(imgui.new('const char*', data.img.hint_data), #data.img.hint_data)
	data.img.bg = imgui.CreateTextureFromFileInMemory(imgui.new('const char*', data.img.bg_data), #data.img.bg_data)
	local ImVec4 = imgui.ImVec4
	local style = imgui.GetStyle()
    local colors = style.Colors
    local clr = imgui.Col
    colors[clr.Button]                 = ImVec4(184/256,91/256,26/256,0.7)
    colors[clr.ButtonHovered]          = ImVec4((50+184)/256,(50+91)/256,(50+26)/256,0.7)
    colors[clr.SliderGrab]       	   = ImVec4(184/256,91/256,26/256,0.7)
    colors[clr.SliderGrabActive]       = ImVec4((50+184)/256,(50+91)/256,(50+26)/256,0.7)

    colors[clr.FrameBg]       	   = ImVec4((50+50+184)/256,(50+50+50+91)/256,(50+50+50+26)/256,0.7)
    colors[clr.FrameBgActive]       = ImVec4(184/256,91/256,26/256,0.7)
    colors[clr.FrameBgHovered]       = ImVec4((50+50+184)/256,(50+50+50+91)/256,(50+50+50+26)/256,0.7)
end)
function convertTime(time)
	local asd = ""
	if time < 0 then return "0s" end
	if time > 60*60*24 then
		asd = asd..math.floor(time/60*60*24).."d "
		time = time - math.floor(time/60*60*24)*60*60*24
	end
	if time > 60*60 then
		asd = asd..math.floor(time/60*60).."h "
		time = time - math.floor(astimed/60*60)*60*60
	end
	if time > 60 then
		asd = asd..math.floor(time/60).."m "
		time = time - math.floor(time/60)*60
	end
	if time > 0 then asd = asd..time.."s " end
	return asd:sub(1)
end
function imgui.ToggleButton(text, bool, a_speed)
    local p  = imgui.GetCursorScreenPos()
    local dl = imgui.GetWindowDrawList()
    local bebrochka = false
    local label, label_true      = text or "", text or ""
    local h          = imgui.GetTextLineHeightWithSpacing() --  
    local w,r,s      = h * 1.7, h / 2, a_speed or 0.2
    local function ImSaturate(f) return f < 0.0 and 0.0 or (f > 1.0 and 1.0 or f) end
    local x_begin = bool[0] and 1.0 or 0.0
    local t_begin = bool[0] and 0.0 or 1.0
    if LastTime == nil then LastTime = {} end
    if LastActive == nil then LastActive = {} end
    if imgui.InvisibleButton(label, imgui.ImVec2(w, h)) then
        bool[0] = not bool[0]
        LastTime[label] = os.clock()
        LastActive[label] = true
        bebrochka = true
    end
    if LastActive[label] then
        local time = os.clock() - LastTime[label]
        if time <= s then
            local anim = ImSaturate(time / s)
            x_begin = bool[0] and anim or 1.0 - anim
            t_begin = bool[0] and 1.0 - anim or anim
        else LastActive[label] = false end
    end
    local bg_color = imgui.ImVec4(x_begin * 0.13, x_begin * 0.9, x_begin * 0.13, imgui.IsItemHovered(0) and 0.7 or 0.9) --  
    local t_color  = imgui.ImVec4(1, 1, 1, x_begin) --    false
    local t2_color = imgui.ImVec4(1, 1, 1, t_begin) --    true
    dl:AddRectFilled(imgui.ImVec2(p.x, p.y), imgui.ImVec2(p.x + w, p.y + h), imgui.GetColorU32Vec4(bg_color), r)
    dl:AddCircleFilled(imgui.ImVec2(p.x + r + x_begin * (w - r * 2), p.y + r), t_begin < 0.5 and x_begin * r or t_begin * r, imgui.GetColorU32Vec4(imgui.ImVec4(0.9, 0.9, 0.9, 1.0)), r + 5)
    dl:AddText(imgui.ImVec2(p.x + w + r, p.y + r - (r / 2) - (imgui.CalcTextSize(label).y / 4)), imgui.GetColorU32Vec4(t_color), label_true)
    dl:AddText(imgui.ImVec2(p.x + w + r, p.y + r - (r / 2) - (imgui.CalcTextSize(label).y / 4)), imgui.GetColorU32Vec4(t2_color), label)
    return bebrochka
end
function imgui.TextQuestion(label, description)
    imgui.TextDisabled(label)
    if imgui.IsItemHovered() then
        imgui.BeginTooltip()
            imgui.PushTextWrapPos(600)
                imgui.TextUnformatted(description)
            imgui.PopTextWrapPos()
        imgui.EndTooltip()
    end
end